import React from "react";
import logoIcon from "./images/logo-icon.png";
import lightLogo from "./images/logo-light-text.png";
import lightIcon from "./images/logo-light-icon.png";
import user from "./images/orgxtopaz.png";
import $ from "jquery";
import parse from "html-react-parser";

function Investor() {

  const Approve =(e)=>{
  alert(e)
  }
  const Cancel=(e)=>{
  alert(e)
  }

  function addCustomer() {
    alert("Making in process");
  }

  return (
    <div>
      {/* ============================================================== */}
      {/* Preloader - style you can find in spinners.css */}
      {/* ============================================================== */}
      <div className="preloader">
        <div className="lds-ripple">
          <div className="lds-pos" />
          <div className="lds-pos" />
        </div>
      </div>
      {/* ============================================================== */}
      {/* Main wrapper - style you can find in pages.scss */}
      {/* ============================================================== */}
      <div
        id="main-wrapper"
        data-layout="vertical"
        data-navbarbg="skin5"
        data-sidebartype="full"
        data-sidebar-position="absolute"
        data-header-position="absolute"
        data-boxed-layout="full"
      >
        {/* ============================================================== */}
        {/* Topbar header - style you can find in pages.scss */}
        {/* ============================================================== */}
        <header className="topbar" data-navbarbg="skin5">
          <nav className="navbar top-navbar navbar-expand-md navbar-dark">
            <div className="navbar-header" data-logobg="skin5">
              {/* ============================================================== */}
              {/* Logo */}
              {/* ============================================================== */}
              <a className="navbar-brand" href="/">
                {/* Logo icon */}
                <b className="logo-icon">
                  {/* Dark Logo icon */}
                  <img
                    src="https://i.scdn.co/image/ab6761610000e5ebc02d416c309a68b04dc94576"
                    alt="homepage"
                    className="dark-logo"
                  />
                  {/* Light Logo icon */}
                  <img src={lightIcon} alt="homepage" className="light-logo" />
                </b>
                {/*End Logo icon */}
                {/* Logo text */}
                <span className="logo-text">
                  {/* dark Logo text */}
                  <img src={logoIcon} alt="homepage" className="dark-logo" />
                  {/* Light Logo text */}
                  {/* <img src={lightLogo}  style={{width:""}}className="light-logo" alt="homepage" /> */}
                </span>
              </a>
              {/* ============================================================== */}
              {/* End Logo */}
              {/* ============================================================== */}
              {/* This is for the sidebar toggle which is visible on mobile only */}
              <a
                className="nav-toggler waves-effect waves-light d-block d-md-none"
                href="javascript:void(0)"
              >
                <i className="ti-menu ti-close" />
              </a>
            </div>
            {/* ============================================================== */}
            {/* End Logo */}
            {/* ============================================================== */}
            <div
              className="navbar-collapse collapse"
              id="navbarSupportedContent"
              data-navbarbg="skin5"
            >
              {/* ============================================================== */}
              {/* toggle and nav items */}
              {/* ============================================================== */}

              {/* ============================================================== */}
              {/* Right side toggle and nav items */}
              {/* ============================================================== */}
            </div>
          </nav>
        </header>
        {/* ============================================================== */}
        {/* End Topbar header */}
        {/* ============================================================== */}
        {/* ============================================================== */}
        {/* Left Sidebar - style you can find in sidebar.scss  */}
        {/* ============================================================== */}
        <aside className="left-sidebar" data-sidebarbg="skin6">
          {/* Sidebar scroll*/}
          <div className="scroll-sidebar">
            {/* Sidebar navigation*/}
            <nav className="sidebar-nav">
              <ul id="sidebarnav">
                {/* User Profile*/}
                <li>
                  {/* User Profile*/}
                  <div className="user-profile d-flex no-block dropdown m-t-20">
                    <div className="user-pic">
                      <img
                        src={user}
                        alt="users"
                        className="rounded-circle"
                        width={40}
                      />
                    </div>
                    <div className="user-content hide-menu m-l-10">
                      <a
                        href="#"
                        className
                        id="Userdd"
                        role="button"
                        data-bs-toggle="dropdown"
                        aria-haspopup="true"
                        aria-expanded="false"
                      >
                        <h5 className="m-b-0 user-name font-medium">
                          Orgxtopaz <i className="fa fa-angle-down" />
                        </h5>
                        <span className="op-5 user-email">
                          orgxtopaz@gmail.com
                        </span>
                      </a>
                      <div
                        className="dropdown-menu dropdown-menu-end"
                        aria-labelledby="Userdd"
                      >
                        <a className="dropdown-item" href="javascript:void(0)">
                          <i className="fa fa-power-off m-r-5 m-l-5" /> Logout
                        </a>
                      </div>
                    </div>
                  </div>
                  {/* End User Profile*/}
                </li>

                {/* User Profile*/}
                <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="/adminHome" aria-expanded="false"><i className="mdi mdi-view-dashboard" /><span className="hide-menu">Dashboard</span></a></li>

                <li className="sidebar-item">
                  {" "}
                  <a
                    className="sidebar-link waves-effect waves-dark sidebar-link"
                    href="/adminPosts"
                    aria-expanded="false"
                  >
                    <i className="mdi mdi-newspaper" />
                    <span className="hide-menu">Business</span>
                  </a>
                </li>
                
              </ul>
            </nav>
            {/* End Sidebar navigation */}
          </div>
          {/* End Sidebar scroll*/}
        </aside>
        {/* ============================================================== */}
        {/* End Left Sidebar - style you can find in sidebar.scss  */}
        {/* ============================================================== */}
        {/* ============================================================== */}
        {/* Page wrapper  */}
        {/* ============================================================== */}
        <div className="page-wrapper">
          {/* ============================================================== */}
          {/* Bread crumb and right sidebar toggle */}
          {/* ============================================================== */}
          <div className="page-breadcrumb">
            <div className="row align-items-center">
              <div className="col-5">
                <div className="d-flex align-items-center">
                  <nav aria-label="breadcrumb">
                    <ol className="breadcrumb">
                      <li className="breadcrumb-item">
                        <a href="#">Home</a>
                      </li>
                      <li
                        className="breadcrumb-item active"
                        aria-current="page"
                      >
                        Overview
                      </li>
                    </ol>
                  </nav>
                </div>
              </div>
            </div>
          </div>
          {/* ============================================================== */}
          {/* End Bread crumb and right sidebar toggle */}
          {/* ============================================================== */}
          {/* ============================================================== */}
          {/* Container fluid  */}
          {/* ============================================================== */}
          <div className="container-fluid">
            {/* ============================================================== */}
            {/* Sales chart */}
            {/* ============================================================== */}
         
            {/* ============================================================== */}
            {/* Sales chart */}
            {/* ============================================================== */}
            {/* ============================================================== */}
            {/* Table */}
            {/* ============================================================== */}
            <div className="row">
              {/* column */}
              <div className="col-12">
                <div className="card">
                  <div className="card-body">
                    {/* title */}
                    <div className="d-md-flex">
                      <div>
                        <h4
                          className="card-title"
                          style={{ textAlign: "left" }}
                        >
                          All Investors request
                        </h4>
                        <h5
                          className="card-subtitle"
                          style={{ textAlign: "left" }}
                        >
                          Cancel or Approve the request
                        </h5>
                      </div>
                      
                    </div>
                    {/* title */}
                  </div>
                  <div className="table-responsive">
                    <table className="table v-middle" id="mytable">
                      <thead>
                        <tr className="bg-light">
                          <th className="border-top-0">Username</th>
                          <th className="border-top-0">Email Address</th>
                          <th className="border-top-0">Total Balance</th>
                          <th className="border-top-0">Amount</th>
                          <th className="border-top-0">Status</th>
                          <th className="border-top-0">Action</th>
                          <th className="border-top-0"></th>
                        </tr>
                      </thead>
                      <tbody>
                        <tr>
                          <td>
                            <div className="d-flex align-items-center">
                              <div className>
                                <h4 className="m-b-0 font-16">orgxtopaz11</h4>
                              </div>
                            </div>
                          </td>
                          <td>edwardo@gmail.com</td>

                          <td>
                            <label className="label label-warning">
                              Deposit
                            </label>
                          </td>
                          <td>1000</td>
                          <td>Pending</td>

                          <td    onClick={() => {
                          Approve("Inprocess")}}>
                            {" "}
                            <label
                              style={{ cursor: "pointer" }}
                              className="label label-success"
                          

                            >
                              Approve
                            </label>
                          </td>

                          <td   onClick={() => {
                          Cancel("Inprocess")}}>
                            {" "}
                            <label
                              style={{ cursor: "pointer" }}
                              className="label label-danger"
                            

                            >
                              Cancel
                            </label>
                          </td>
                        </tr>


                        <tr>
                          <td>
                            <div className="d-flex align-items-center">
                              <div className>
                                <h4 className="m-b-0 font-16">orgxtopaz</h4>
                              </div>
                            </div>
                          </td>
                          <td>edwardo@gmail.com</td>

                          <td>
                            <label className="label label-warning">
                              Withdraw
                            </label>
                          </td>
                          <td>1000</td>
                          <td>Approved</td>

                          <td  onClick={() => {
                          Approve("Inprocess")}}>
                            {" "}
                            <label
                              style={{ cursor: "pointer" }}
                              className="label label-success"
                             

                            >
                              Approve
                            </label>
                          </td>

                          <td   onClick={() => {
                          Cancel("Inprocess")}}>
                            {" "}
                            <label
                              style={{ cursor: "pointer" }}
                              className="label label-danger"
                             
                            >
                              Cancel
                            </label>
                          </td>
                        </tr>
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
            {/* ============================================================== */}
            {/* Table */}
            {/* ============================================================== */}
            {/* ============================================================== */}
            {/* Recent comment and chats */}
            {/* ============================================================== */}
          </div>

          {/* footer */}
          {/* ============================================================== */}
          <footer className="footer text-center">
            All Rights Reserved by Orgxtopaz. Designed and Developed by{" "}
            <a href="https://www.fiverr.com/orgxtopaz">Orgxtopaz</a>.
          </footer>
          {/* ============================================================== */}
          {/* End footer */}
          {/* ============================================================== */}
        </div>
        {/* ============================================================== */}
        {/* End Page wrapper  */}
        {/* ============================================================== */}
      </div>
    </div>
  );
}

export default Investor;
